def extract_tag(page, label, approach='first', raise_error=False):


    if approach == 'first':

        try:
            tag = page.find(label).extract()
        except AttributeError:
            if raise_error:
                raise
            else:
                tag = None

    elif approach == 'all':

        tag = []
        try:
            while True:
                tag.append(page.find(label).extract())
        except AttributeError:
            if not tag:
                if raise_error:
                    raise
                else:
                    tag = None

    return page, tag

