def float2bin(afloat: float):

    integer_part = int(afloat)  # 
    decimal_part = afloat - integer_part  # 
    decimal_bin = "."  #   
    while decimal_part != 0.0:
        foo = decimal_part * 2
        bar = int(foo)
        decimal_bin += str(bar)
        decimal_part = foo - bar
    return float(bin(integer_part)[2:] + decimal_bin)

