def reduce(tensor, dim=None, reduction='sum'):

    reduction_map = {
        'sum': torch.sum,
        'mean': torch.mean,
        'none': lambda x, dim=None: x
    }
    if dim is None:
        return reduction_map[reduction](tensor)

    return reduction_map[reduction](tensor, dim=dim)

